<script>
 $( "form" ).submit(function( event ) {
	event.preventDefault();
$.post("http://192.168.1.3/webfaciles/datos/ingreso.ajax",
 { 
 datos: $(this).serializeArray(),movil:true },
 function(data,status){
 console.log(data);
 if (status=="success") {
 	if(data=="1"){
 		console.log("Incorrecto");
 		localStorage.ingreso=false;
 		alert("Usuario o Contraseña incorrecta");
 	}else {
 		console.log("correcto");
 		localStorage.ingreso=true; 
 		localStorage.token=btoa(document.getElementsByName("nombre_cuenta")[0].value+":"+document.getElementsByName("clave_cuenta")[0].value);
 		window.location = "#/";
 	}
 
 } else{


 };
 });


 
 });
</script>
